import React, { useState } from "react";
import "../Styles/Navbar.css";
import { Link } from "react-router-dom";
import styled from "styled-components";

function Navbar() {
  const [navbar, setNavbar] = useState(false);

  const shrinkNavbar = () => {
    if (window.scrollY >= 20) {
      setNavbar(true);
    } else {
      setNavbar(false);
    }
  };

  window.addEventListener("scroll", shrinkNavbar);

  return (
    <>
      <BackgroundImage>
        <div className={navbar ? "nav-shrink" : "nav-large"}>
          <div className="navbarContainer">
            <div className="title-logo-container">
              <Link to="/random">
                <img src="" alt="logo from db" className="logo" />
              </Link>
              <h5>GES TEXT FROM DB</h5>
            </div>
            <div className="navigation-container">
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
            </div>
          </div>
        </div>
      </BackgroundImage>
    </>
  );
}

export default Navbar;

const BackgroundImage = styled.div`
  background-image: url("./images/college.jpg");
  height: 85vh;
  width: auto;
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  overflow: hidden;
  mask-image: linear-gradient(to bottom, rgba(0, 0, 0, 1), rgba(0, 0, 0, -1));
`;
